import React from 'react';
import Header from '../../components/header';
import "./style.css";

const ContactUs = () => {
    return (
        <div>
            <Header />
            <div class="login-wrap">
                <div class="login-html">
                    <h2 className="h2tag">Contact Us At:</h2>
                    <h4>Arpit Bharadwaj</h4>
                </div>
            </div>
        </div>
    );
}

export default ContactUs;
